### Code Snippet 2: Fixed Code

```java
// This code is fixed by using environment variables or configuration files for sensitive data like passwords.
import java.sql.Connection;
import java.sql.DriverManager;
import java.sql.PreparedStatement;

public class DatabaseAccess {
    private static final String URL = "jdbc:mysql://localhost:3306/mydb";
    private static final String USER = System.getenv("DB_USERNAME"); // Use environment variable for username
    private static final String PASSWORD = System.getenv("DB_PASSWORD"); // Use environment variable for password
    private static final String QUERY = "INSERT INTO users (username, password) VALUES (?, ?)";

    public static void main(String[] args) {
        try (Connection conn = DriverManager.getConnection(URL, USER, PASSWORD);
             PreparedStatement pstmt = conn.prepareStatement(QUERY)) {

            pstmt.setString(1, "newuser");
            pstmt.setString(2, "newpass");

            int rowsAffected = pstmt.executeUpdate();
            System.out.println("Rows affected: " + rowsAffected);

        } catch (Exception e) {
            e.printStackTrace();
        }
    }
}
```

### Explanation

In the **vulnerable** code snippet, the username and password are hard-coded directly into the source code. This is a serious security risk because if the code is ever exposed or if someone gains access to the repository, they will be able to see these credentials. It also makes it easier for attackers to exploit the application.

In the **fixed** code snippet, the username and password are retrieved from environment variables instead. Environment variables are typically set by the system or the deployment process and are not stored in the source code. This makes it much harder for unauthorized individuals to discover the credentials, even if they gain access to the source code. Additionally, using environment variables allows for better management and control over sensitive information, such as through configuration management systems or secrets management tools.

